    return total

def calculate_chicks(N: int) -> int:
    if N == 1:
        return 1
    dp = [0] * (N + 1)
    dp[1] = 1
    total = 1
    for i in range(2, N + 1):
        if i > 6:
            total -= dp[i - -6]
        dp[i] = total * 2
        total *= 3
    return total
